// import { heroes } from './data/heroes';
import { heroes } from "./data/heroes";

const mio = 4;
const getHeroeById = ( id ) => {
    return heroes.find( heroe => heroe.id === id );
}

const getHeroeByOwner = ( owner ) => {
    return heroes.filter( heroe => heroe.owner === owner); 
}

console.log(getHeroeById( mio ));
